webpackJsonp([0xe657d625892b],{559:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Eh, I Could Eat",author:"Jacob Aronoff"}},markdownRemark:{id:"/Users/jea/Documents/Code/github/icouldeat/src/pages/jun-men-ramen/index.md absPath of file >>> MarkdownRemark",html:'<h3>Sweet Potato Fries</h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/picture1-239210765abb4a33dd242ded089131b5-99c36.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Sweet Potato Fries"\n        title=""\n        src="/static/picture1-239210765abb4a33dd242ded089131b5-f8fb9.jpg"\n        srcset="/static/picture1-239210765abb4a33dd242ded089131b5-e8976.jpg 148w,\n/static/picture1-239210765abb4a33dd242ded089131b5-63df2.jpg 295w,\n/static/picture1-239210765abb4a33dd242ded089131b5-f8fb9.jpg 590w,\n/static/picture1-239210765abb4a33dd242ded089131b5-85e3d.jpg 885w,\n/static/picture1-239210765abb4a33dd242ded089131b5-d1924.jpg 1180w,\n/static/picture1-239210765abb4a33dd242ded089131b5-9452e.jpg 1770w,\n/static/picture1-239210765abb4a33dd242ded089131b5-99c36.jpg 3024w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Uni Mushroom Ramen</h3>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/picture-5f5ffd8f8eec7739d4fba3e2dca8a4b8-99c36.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 83.82936507936508%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Uni Mushroom Ramen"\n        title=""\n        src="/static/picture-5f5ffd8f8eec7739d4fba3e2dca8a4b8-f8fb9.jpg"\n        srcset="/static/picture-5f5ffd8f8eec7739d4fba3e2dca8a4b8-e8976.jpg 148w,\n/static/picture-5f5ffd8f8eec7739d4fba3e2dca8a4b8-63df2.jpg 295w,\n/static/picture-5f5ffd8f8eec7739d4fba3e2dca8a4b8-f8fb9.jpg 590w,\n/static/picture-5f5ffd8f8eec7739d4fba3e2dca8a4b8-85e3d.jpg 885w,\n/static/picture-5f5ffd8f8eec7739d4fba3e2dca8a4b8-d1924.jpg 1180w,\n/static/picture-5f5ffd8f8eec7739d4fba3e2dca8a4b8-9452e.jpg 1770w,\n/static/picture-5f5ffd8f8eec7739d4fba3e2dca8a4b8-99c36.jpg 3024w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>This place was a perfect modern ramen shop. The lights were dim, the noise was loud, but you could still talk, and they had some good music playing. Behind the counter were the chefs working hard. My friend and I ordered the BBQ Pork Buns to start as well as the sweet potato fries. I’m very sure that the BBQ pork buns were among the best I’ve ever had. The fries were also awesome; very cripsy on the outside but creamy on the inside, they also came with a great mayo. For my main I got the uni mushroom mazeman, which was really good, but very heavy. It tasted almost like pasta because it was so rich. It had classic pasta ingredients as well like pancetta. It was amazing, but not my favorite mazeman I’ve ever had (the best one was Yume Wo Katare’s mushroom mazeman at their pop-up over the summer). I definitely felt the prices were fair though, the pork buns were very reasonably priced, and the ramen I got was expensive, which made sense given the ingredients.</p>\n<p>Rating: 8.5/10</p>',frontmatter:{title:"Jun-Men Ramen",date:"February 14, 2018"}}},pathContext:{slug:"/jun-men-ramen/",previous:{fields:{slug:"/tipsy-parson/"},frontmatter:{title:"Tipsy Parson"}},next:{fields:{slug:"/kame-ramen/"},frontmatter:{title:"Kame Ramen"}}}}}});
